import {AiOutlineShoppingCart} from "react-icons/ai"

const Navbar = () => {
  return (
    <div>
      <div className="flex-row justify-between felx">
        <img src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fcdn.dribbble.com%2Fusers%2F2948332%2Fscreenshots%2F5926397%2F4.jpg&tbnid=xJKuN9jUDSW-VM&vet=12ahUKEwiMr-vWltb_AhUelmMGHXFSClQQMygnegUIARC_Ag..i&imgrefurl=https%3A%2F%2Fdribbble.com%2Fshots%2F5926397-Ecommerce-Logo-Design&docid=9ueol59AC2DLUM&w=1200&h=900&q=ecommerce%20logo&ved=2ahUKEwiMr-vWltb_AhUelmMGHXFSClQQMygnegUIARC_Ag" />
        <div>
          <p><Home></Home></p>
          <AiOutlineShoppingCart />
        </div>
      </div>
    </div>
  )
};

export default Navbar;
